+#spacing_best_seller_mobile{
+display:block !important;
+}
+.line-1{
+font-size:140%;
+}
+
+#footer_follow_us{
+font-size: 1.5vw;
+}
+#footer_instagram{
+width:105px !important;
+font-size:1vw !important;
+}
+#footer_tiktok{
+width:105px !important;
+font-size:1vw !important;
+}
+#footer_shopee{
+width:105px !important;
+font-size:1vw !important;
+}
+
+#kotak_ayn_collection{
+margin-top:20px ;
+}
+#footer_tagline{
+font-size: 1vw;
+}
+
+
+}
+
